import React from 'react'
import { NavLink } from 'react-router-dom'

const Cartbtn = () => {
    return (
        <div>
            <NavLink className="btn" btn-outline-primary>
                <span className="fa fa-shopping cart me-1"> Carrito ()</span>

            </NavLink>
        </div>
    )
}

export default Cartbtn
